import * as React from 'react';
import {
  Button,
  View,
  Text,
  SafeAreaView
} from 'react-native';
import { HStack, Stack, Center, NativeBaseProvider, Container, Heading } from "native-base"

const FirstPage = ({ navigation }) => {
  return (
    <SafeAreaView style={{ flex: 1 }}>
      <Container>
      <Heading>
        A component library for the
        <Heading color="emerald.400">
          React Ecosystem
        </Heading>
      </Heading>
      <Heading pt={4} fontWeight="md" size="sm">
        NativeBase is a simple, modular and accessible component library that gives you building blocks to build you React applications.
      </Heading>
    </Container>
      <View style={{ flex: 1 , padding: 16}}>
          <Button
            onPress={
              () => navigation.navigate('ThirdPage')
            }
            title="Go to Third Page"
          />
      </View>
    </SafeAreaView>
  );
}

export default FirstPage;
